def calculate_game_outcomes(n):
    soln = {2: [-1, 0, 1]}
    for n in range(4, 62, 2):
        a = int(nChooseK(n, n // 2)) // 2 % 998244353
        b = int(nChooseK(n - 2, n // 2 - 2)) % 998244353
        a += soln[n - 2][1]
        b += soln[n - 2][0]
        a = a % 998244353
        b = b % 998244353
        soln[n] = [a, b, 1]
    return tuple(soln[n])

